import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Drawer from "@material-ui/core/Drawer";
import MovieIcon from "@material-ui/icons/Movie";
import PeopleIcon from "@material-ui/icons/People";
import List from "@material-ui/core/List";
import CssBaseline from "@material-ui/core/CssBaseline";
import ListItem from "@material-ui/core/ListItem";
import MovieManagement from "../../components/MovieManagement/MovieManagement";
import ClientMaragement from "../../components/ClientManagement/ClientMaragement";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  drawerClose: {
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    overflowX: "hidden",
    width: theme.spacing(7) + 1,
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing(9) + 1,
      marginTop: "60px",
      height: "100%",
    },
  },
  toolbar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
    padding: theme.spacing(0, 1),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));

export default function Admin() {
  const classes = useStyles();

  const [open, setOpen] = React.useState(false);

  return (
    <div className={classes.root}>
      <CssBaseline />
      <Drawer
        variant="permanent"
        className={classes.drawerClose}
        classes={{
          paper: [classes.drawerClose],
        }}
      >
        <List>
          <ListItem
            button
            onClick={() => {
              setOpen(false);
            }}
            label="Item One"
          >
            <MovieIcon label="Item One"/>
          </ListItem>
          <ListItem
            button
            onClick={() => {
              setOpen(true);
            }}
          >
            <PeopleIcon />
          </ListItem>
        </List>
      </Drawer>
      <main className={classes.content}>
        {open ? <ClientMaragement /> : <MovieManagement />}
      </main>
    </div>
  );
}
